var access_key=getUrlParameter("token"),subsubcategory_id=getUrlParameter("subsubcategory_id");$(function(){$.ajax({type:"GET",url:REMOTE_APPLICATION_URL+"/api/v2/product.php",data:{token:access_key,subsubcategory_id:subsubcategory_id},success:function(t){var e=[];$.each(t,function(t,a){e.push("<tr><td class='text-center align-middle'>"+a.id+"</td><td class='text-center align-middle'><img src='"+REMOTE_APPLICATION_URL+"/assets/img/products/"+a.peopleid+"/"+a.id+".jpg' width='100px' /></td><td class='text-center align-middle large-text'>"+a.name+"</td><td class='text-center align-middle large-text'>"+a.first_name+" "+a.last_name+"</td><td class='text-center align-middle'><span class='label bg-brown text-white larger-text'>"+a.currency+" "+a.price+" / "+a.unit.toUpperCase()+"</span></td><td class='text-center align-middle large-text'>"+a.location+"</td><td class='text-center align-middle large-text'>"+a.created_at+"</td><td class='text-center align-middle'><a href='/product/view?id="+a.id+"&token="+access_key+"' class='btn btn-block btn-primary btn-cons'><i class='fa fa-eye'></i>&nbsp;View</a></td></tr>")}),$("<tbody/>",{html:e.join("")}).appendTo("#productTable"),$("#productTable").DataTable({responsive:!0})}})});